//计算保费折扣率
function Get_Dis_BF_Rate(be){
var x = 0;
if(be>=40){ x = 0.4;}
else if(be>=30){x = 0.3;}
else if(be>=20){x = 0.2;}
else if(be>=15){x = 0.1;}
return x;
}

/*
计算保费折扣
投保额		>=15W	>=20W	>=30W	>=40W
折扣率		0.1	      0.2	 0.3     0.4
*/
function dis_bf(bf,be){         //bf-保费,be-保额
var Dis_rate,x;
Dis_rate = Get_Dis_BF_Rate(be);
x = bf - Dis_rate
return x*be*10 ;
}

/*
dis_be(sex,age,nian,smoke,bf)
知道保费预算求保额
sex-性别,男0女1,
age-年龄,nian-供款年期,smoke-非吸烟0,吸烟1     
bf-保费,be-保额
*/

function dis_be(sex,age,nian,smoke,bf){    //sex-性别,男0女1,age-年龄,nian-供款年期,smoke-非吸烟0,吸烟1 bf-保费
var x=0,dis1,dis2,dis3,dis4,dis5,bfl;
bfl = chk_bfl(sex,smoke,nian,age); //计算基础保费率
//计算折扣对应的保费
//dis1 = dis_bf(bfl,12); //12W保额对应的保费
dis2 = dis_bf(bfl,15); //15W保额对应的保费
dis3 = dis_bf(bfl,20); //20W保额对应的保费
dis4 = dis_bf(bfl,30); //30W保额对应的保费
dis5 = dis_bf(bfl,40); //40W保额对应的保费

if(bf>=dis5){ x = 0.4;}
else if(bf>=dis4){x = 0.3;}
else if(bf>=dis3){x =0.2;}
else if(bf>=dis2){x = 0.1;}

return bf/(10*(bfl-x));
}


